import Footer from './components/Footer'
import {Container , Rows , Cols} from 'react-bootstrap'
import Header from './components/Header'
function App() {
  return (
    <>
      <Header />
      <Container>
      <main>
        welcome to shoppzy
      </main>
      </Container>
      <Footer />
    </>
  );
}

export default App;
